import React from "react";

function RecentWorks() {
	return (
		<div style={styles.container}>
			<h2 style={styles.titleBar}>Recent Works</h2>
			<div style={styles.miniShader}>shader 1</div>
			<div style={styles.miniShader}>shader 2</div>
			<div style={styles.miniShader}>shader 3</div>
		</div>
	);
}

export default RecentWorks;

const styles = {
	container: {
		display: "flex",
		flexDirection: "row", // Align items horizontally
		gap: "1rem", // Add some space between shaders (optional)
		alignItems: "center",
		marginTop: "20px",
		height: "45vh",
		background: "rgba(250, 250, 250, 0.69)",
		width: "80vw",
		margin: "auto",
		borderRadius: "5px",
	},
	titleBar: {
		display: "flex",
		flexDirection: "column",
		width: "80vw",
		paddingTop: "5px",
		margin: "0",
		height: "4vh",
		background: "black",
		textAlign: "center",
		borderRadius: "5px 5px 0px 0px",
	},
	miniShader: {
		color: "black",
	},
};
